addSharedEventListener("onAmmoLoaded", () => { // ready = before AI_Init or communicator ready, we start as soon as full_simulation_bundle.js has loaded its math
    // Somehow this kdTree reverses the order of points array!
    let tree = new kdTree(points, distance3D, ["x", "y", "z"]);
    points.reverse(); // So now bring the array back to the correct order

    treeNearest = tree.nearest;

    const point = { x: 5, y: 5, z: 5 };
    var nearest = tree.nearest(point, 1);
    console.log(nearest);

    // Query the nearest *count* neighbours to a point, with an optional maximal search distance.
    // Result is an array with *count* elements.
    // Each element is an array with two components: the searched point and the distance to it.
    // tree.nearest(point, count, [maxDistance]);


    const progress = getProgress(nearest[0][0], nearest[0][1]);
    //console.log("Progress:", (progress / points.length * 100).toFixed(2) + "%");

});


function getProgress(nearestPoint, nearestDistance) {
    const nearestIndex = points.indexOf(nearestPoint);
    //const distance = Math.sqrt(nearestDistance); // convert to actual distance
    //console.log("i:", nearestIndex);
    //console.log("d:", distance);

    return nearestIndex;
}
